import React from 'react';
import NavbarStyle from './Navbar.module.scss';
import logo from './Images/logo.webp';
const Navbar = () => {
	return (

		<nav className={NavbarStylenavbar}>
			<div className="">
				<div className="logo">
					<img src={logo} alt="Portfolio" />
				</div>
				<div className="navbar-nav">
					<div className="nav-item"> <a className='nav-link' href="#" >Home</a> </div>
					<div className="nav-item"> <a className='nav-link' href="#" >About</a> </div>
					<div className="nav-item"> <a className='nav-link' href="#" >Services</a> </div>
					<div className="nav-item"> <a className='nav-link' href="#" >Portfolio</a> </div>
					<div className="nav-item"> <a className='nav-link' href="#" >Page</a> </div>
					<div className="nav-item"> <a className='nav-link' href="#" >Contact</a> </div>
					<div className="nav-button"> <a href="#" >Get Free Consultant</a> </div>
				</div>
			</div>
		</nav>

	);
}
export default Navbar;
